package main

import "fmt"

func shortestPalindrome(s string) string {
	if len(s) <= 1 {
		return s
	}
	var (
		i   = len(s) / 2
		mid = false
	)
	if len(s)%2 == 0 {
		mid = true
	}
	for i >= 0 {
		if r, ok := tryPalindrome(i, mid, s); ok {
			return r
		}
		if mid {
			i--
		}
		mid = !mid
	}
	return "" // doesn't compile otherwise
}

func tryPalindrome(i int, mid bool, s string) (string, bool) {
	var (
		a = i
		b = i
	)
	if mid {
		a--
	}
	for a >= 0 {
		if s[a] != s[b] {
			return "", false
		}
		a--
		b++
	}
	return reverse(s[b:]) + s, true
}

func reverse(s string) string {
	var (
		b = []byte(s)
		i = 0
		j = len(s) - 1
	)
	for i < j {
		b[i], b[j] = b[j], b[i]
		i++
		j--
	}
	return string(b)
}

func main() {
	fmt.Println(shortestPalindrome("") == "")
	fmt.Println(shortestPalindrome("a") == "a")
	fmt.Println(shortestPalindrome("aa") == "aa")
	fmt.Println(shortestPalindrome("aaa") == "aaa")
	fmt.Println(shortestPalindrome("aba") == "aba")
	fmt.Println(shortestPalindrome("abb") == "bbabb")
	fmt.Println(shortestPalindrome("cbca") == "acbca")
	fmt.Println(shortestPalindrome("aacecaaa") == "aaacecaaa")
	fmt.Println(shortestPalindrome("abcd") == "dcbabcd")
	fmt.Println(shortestPalindrome("abbacd") == "dcabbacd")
	fmt.Println(shortestPalindrome("babbbabbaba") == "ababbabbbabbaba")
	fmt.Println(shortestPalindrome(""))
}
